            "bisqEasy.walletGuide.createWallet.content" to "Bluewallet te permite crear varias carteras para diferentes propósitos. Por ahora, solo necesitas tener una cartera. Una vez que entres en Bluewallet, verás un mensaje que te sugiere agregar una nueva cartera. Una vez que lo hagas, añade un nombre para tu cartera y elige la opción *Bitcoin* en la sección *Tipo*. Puedes dejar todas las demás opciones tal como aparecen y hacer clic en *Crear*.\n\nCuando pases al siguiente paso, se te presentarán 12 palabras. Estas 12 palabras son la copia de seguridad que te permite recuperar tu cartera si le sucede algo a tu teléfono. Escríbelas en un papel (no digitalmente) en el mismo orden en el que se presentan, guárdalas de manera segura y asegúrate de que solo tú tengas acceso a ellas. Puedes obtener más información sobre cómo asegurar tu cartera en las secciones de Aprender de Bisq Easy dedicadas a cartera y seguridad.\n\nUna vez que hayas terminado, haz clic en 'Ok, lo escribí'.\n¡Felicidades! ¡Has creado tu cartera! Continuemos con cómo recibir tu Bitcoin en ella.",
